(349, 1, '2018-05-14 06:20:56', '2018-05-14 06:20:56', '', 'Second fine art image', 'It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).\r\n\r\n\r\n', 'publish', 'open', 'closed', '', 'second-fine-art-image', '', '', '2018-05-14 06:20:56', '2018-05-14 06:20:56', '', 0, 'http://localhost/brogaard/?post_type=product&#038;p=349', 0, 'product', '', 0),
