(426, 1, '2018-05-17 09:14:44', '2018-05-17 09:14:44', '[vc_row][vc_column][vc_column_text]This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\r\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like piña coladas. (And gettin\' caught in the rain.)</blockquote>\r\n...or something like this:\r\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\r\nAs a new WordPress user, you should go to <a href="http://localhost/brogaard/wp-admin/">your dashboard</a> to delete this page and create new pages for your content. Have fun![/vc_column_text][/vc_column][/vc_row][vc_row][vc_column][mkd_lists bullet_type="icon" unordered_list_items="%5B%7B%22icon_pack%22%3A%22simple_line_icons%22%2C%22fa_icon%22%3A%22%22%2C%22fe_icon%22%3A%22%22%2C%22ion_icon%22%3A%22%22%2C%22linea_icon%22%3A%22%22%2C%22simple_line_icons%22%3A%22icon-earphones-alt%22%2C%22dripicon%22%3A%22%22%2C%22text%22%3A%22%2B45%204057%208090%22%7D%2C%7B%22icon_pack%22%3A%22simple_line_icons%22%2C%22fa_icon%22%3A%22%22%2C%22fe_icon%22%3A%22%22%2C%22ion_icon%22%3A%22%22%2C%22linea_icon%22%3A%22%22%2C%22simple_line_icons%22%3A%22icon-location-pin%22%2C%22dripicon%22%3A%22%22%2C%22text%22%3A%22Refshalevej%20169A%2C%201.DK-%201432%20Cph.%20K%22%7D%2C%7B%22icon_pack%22%3A%22simple_line_icons%22%2C%22fa_icon%22%3A%22%22%2C%22fe_icon%22%3A%22%22%2C%22ion_icon%22%3A%22%22%2C%22linea_icon%22%3A%22%22%2C%22simple_line_icons%22%3A%22icon-envelope%22%2C%22dripicon%22%3A%22%22%2C%22text%22%3A%22INFO%40BROGAA