_icon%22%3A%22%22%2C%22ion_icon%22%3A%22%22%2C%22linea_icon%22%3A%22%22%2C%22simple_line_icons%22%3A%22%22%2C%22dripicon%22%3A%22%22%2C%22text%22%3A%22Passion%2C%20dedication%2C%20and%20a%20lot%20of%20coffee.%22%7D%2C%7B%22icon_pack%22%3A%22font_awesome%22%2C%22fa_icon%22%3A%22%22%2C%22fe_icon%22%3A%22%22%2C%22ion_icon%22%3A%22%22%2C%22linea_icon%22%3A%22%22%2C%22simple_line_icons%22%3A%22%22%2C%22dripicon%22%3A%22%22%7D%5D" animate="no" padding_left="" icon_size="" icon_color="" text_size="" text_color=""][vc_empty_space height="12px"][mkd_button size="medium" type="solid" target="_self" icon_pack="" skin="" font_weight="" text="KNOW MORE" color="#ffffff" background_color="#dd3333" border_color="#dd3333" hover_border_color="#dd3333" hover_color="#ffffff" hover_background_color="#dd3333" link="/brogaard/shop"][vc_empty_space height="12px"][mkd_separator type="full-width" color="#cccccc" thickness="1px" top_margin="43px" bottom_margin="29px"][vc_row_inner row_type="parallax" full_screen_section_height="no"][vc_column_inner width="1/4" offset="vc_col-lg-3 vc_col-md-3 vc_col-xs-6"][vc_single_image image="341" onclick="link_image" el_class="industrial-single-image-custom-class"][vc_empty_space height="30px"][/vc_column_inner][vc_column_inner width="1/4" offset="vc_col-lg-3 vc_col-md-3 vc_col-xs-6"][vc_single_image image="268" onclick="link_image" el_class="industrial-single-image-custom-class"][vc_empty_space height="30px"][/vc_column_inner][vc_column_inner width="1/4" offset="vc_col-lg-3 vc_col-md-3 vc_col-xs-6"][vc_single_image image="340" onclick="link_image" el_class="industrial-single-image-custom-class"][vc_empty_space height="30px"][/vc_column_inner][vc_column_inner width="1/4" offset="vc_col-lg-3 vc_col-md-3 vc_col-xs-6"][vc_single_image image="354" onclick="link_image" el_class="industrial-single-image-custom-class"][vc_empty_space height="30px"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row row_type="parallax" full_screen_section_height="no"][vc_column css=".vc_custom_1526132498672{padding-top: 0px !important;background-color: #dd3333 !important;}"][mkd_call_to_action full_width="yes" content_in_grid="yes" grid_size="75" type="normal" show_button="no" skin="light" box_padding="20px 0 20px 0" text_size="19"]\r\n<h4 style="text-align: center; color: #ffffff;">HONRABLE MENTIONS</h4>\r\nThe book "Danish nobility sience 1849," Gad , being called masterpiece in told the paper - including beacuse of the \'beautiful photographs\'[/mkd_call_to_action][/vc_column][/vc_row][vc_row row_type="parallax" content_width="grid" full_screen_section_height="no" parallax_background_image="230" css=".vc_custom_1526478860584{margin-right: 0px !important;margin-left: 0px !important;}"][vc_column width="1/2" css=".vc_custom_1526479234536{padding-bottom: 20px !important;padding-left: 30px !important;}"][vc_column_text]\r\n<h2 style="word-break: break-all;">STATEMENTS,PRINTS &amp;</h2>\r\n<h2 style="word-break: break-all;">PHOTOGRAPHS</h2>\r\nStatements,Printing &amp; Photographs at lower cost.[/vc_column_text][vc_column_text][mkd_separator class_name="" type="normal" position="left" color="#dd3333" border_style="solid" width="40px" thickness="3" top_margin="20px" bottom_margin="9px"][/vc_column_text][vc_empty_space][vc_row_inner row_type="parallax" full_screen_section_height="no"][vc_column_inner width="1/4"][product_categories orderby="" order="" columns="1" ids="33"][vc_empty_space height="30px"][/vc_column_inner][vc_column_inner width="1/4"][product_categories orderby="" order="" columns="1" ids="32"][vc_empty_space height="30px"][/vc_column_inner][vc_column_inner width="1/4"][product_categories orderby="" order="" columns="1" ids="31"][vc_empty_space height="30px"][/vc_column_inner][vc_column_inner width="1/4"][product_categories orderby="" order="" columns="1" ids="36"][vc_empty_space height="30px"][/vc_column_inner][/vc_row_inner][/vc_column][vc_column width="1/2"][vc_empty_space height="2px"][vc_single_image image="350" img_